"X\"], [\"Y\"]) \n        #cpt = [pca.mean_ , pca.var_ , pca.components_ , pca.explained_variance_ , pca.explained_variance_ratio_ , pca.singular_values_ ]\n        # Submit the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"start":0},"id":"1185","type":"DataRange1d"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1207"},"group":null,"major_label_orientation":-0.5,"major_label_policy":{"id":"1456"},"minor_tick_line_alpha":0,"ticker":{"id":"1209"}},"id":"1193","type":"LinearAxis"},{"attributes":{"coordinates":null,"formatter":{"id":"1454"},"group":null,"major_label_policy":{"id":"1455"},"ticker":{"id":"1198"}},"id":"1197","type":"CategoricalAxis"},{"attributes":{"tools":[{"id":"1211"}]},"id":"1200","type":"Toolbar"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1242"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1244"},"nonselection_glyph":{"id":"1243"},"view":{"id":"1246"}},"id":"1245","type":"GlyphRenderer"},{"attributes":{"start":0},"id":"1220","type":"DataRange1d"}],"root_ids":["1411"]},"title":"Bokeh Application","version":"2.4.1"}}
